["Q: PHP에서 Firestore에 문서를 추가할 때 사용하는 add() 메서드의 예시는 무엇인가요?
A: PHP에서 Firestore에 문서를 추가할 때 사용하는 add() 메서드의 예시는 다음과 같습니다.

```php
$data = [
	'name' => 'Tokyo',
	'country' => 'Japan'
];
$addedDocRef = $db->collection('samples/php/cities')->add($data);
printf('Added document with ID: %s' . PHP_EOL, $addedDocRef->id());
```"]

["Q: 동영상을 업데이트하는 방법은 무엇인가요?
A: 동영상을 업데이트하려면 `videos.update` 메서드를 사용합니다. 아래는 Apps Script를 사용한 코드 샘플입니다.

```javascript
// Update a video
function updateVideo() {
  var request = YouTube.Videos.update({
    id: 'VIDEO_ID',
    snippet: {
      title: 'Updated Title',
      description: 'Updated Description'
    }
  }, 'snippet');
  Logger.log(request);
}
```"]

reference:
YouTube API에서 기존 동영상의 제목과 설명을 업데이트하려면 `videos.update` 메서드를 사용해야 합니다. Apps Script를 활용한 예시 코드는 다음과 같습니다. 먼저, `YouTube.Videos.update` 함수를 호출하고, 업데이트할 동영상의 ID와 함께 새로운 제목과 설명이 포함된 snippet 객체를 전달합니다. 예를 들어, 아래와 같이 작성할 수 있습니다.

```javascript
// Update a video
function updateVideo() {
  var request = YouTube.Videos.update({
    id: 'VIDEO_ID',
    snippet: {
      title: 'Updated Title',
      description: 'Updated Description'
    }
  }, 'snippet');
  Logger.log(request);
}
```
이 코드는 지정한 동영상의 제목과 설명을 새로운 값으로 변경하며, 업데이트 결과는 Logger를 통해 확인할 수 있습니다.

